function Login(){
    function loginHandle (e)
    {
        e.preventDefault()
    }
return (
    <div>
    <form onSubmit={loginHandle}>
        <h2>Login </h2>
        <input type="text"  placeholder="ENter user Id"></input> <br></br>
        <input type="password"  placeholder="ENter user pasword"></input> <br></br>
        <button type="submit"> Login</button>
        </form>
    </div>
);
}
export default Login;
